import React from "react";
import smileyHappy from "../images/smiley-happy.png";

const SmileyFace = () => {
  //style the img tag

  return (
    <img
      src={smileyHappy}
      alt="Smiley Face"
      style={{ width: "100%", height: "60%" }}
    />
  );
};

export default SmileyFace;
